CREATE TABLE IF NOT EXISTS `travel_system`.`road_connections`(
    `id` int NOT NULL AUTO_INCREMENT,
    `start_id` bigint NOT NULL,
    `end_id` bigint NOT NULL,
    `start_type` enum('building','facility') NOT NULL,
    `end_type` enum('building','facility') NOT NULL,
    `distance` float NOT NULL,
    `congestion` float NOT NULL,
    `ideal_speed` float NOT NULL,
    `is_bike_road` tinyint(1) NOT NULL,
    `is_electric_car_road` tinyint(1) NOT NULL,
    `created_at` timestamp NULL DEFAULT (CURRENT_TIMESTAMP),
    `updated_at` timestamp NULL DEFAULT (CURRENT_TIMESTAMP) ON UPDATE CURRENT_TIMESTAMP,
    PRIMARY KEY  (`id` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ;
